INSERT INTO `content_info_page` VALUES (8,0,'','La plataforma Telco 2.0 es una infraestructura de la FIET de la Universidad del Cauca para la investigación e innovación de servicios de Telecomunicaciones en la nube, cuyo propósito es convertirse en uno de los centros de investigación tecnológico más importantes de la región. En particular, esta plataforma brinda servicios de gestión, almacenamiento y procesamiento de máquinas virtuales.'),(14,3,'img','2019-06-04 19:53:56Captura de pantalla de 2019-05-23 09-47-40.png'),(15,3,'sub','jghjghj'),(16,3,'text','El gran texto'),(17,3,'sub','666'),(18,4,'text','Agregar contenido al titulo'),(19,1,'text','Agregar contenido al titulo'),(20,5,'text','Agregar contenido al titulo'),(21,5,'text','sadsadsadasd');
